import React from 'react';
import Tag from './Tag';

class TagList extends React.Component {
    state = {
        tagname: "MSFT",
        taglist: []
    }

    render(){
        return(
            <div class="tags">
                <span class="tag">{this.state.tagname}<button class="delete is-small"></button></span>
                <span class="tag">AAPL<button class="delete is-small"></button></span>
                <span class="tag">CASH<button class="delete is-small"></button></span>
                <span class="tag">AMD<button class="delete is-small"></button></span>
                <span class="tag">TSLA<button class="delete is-small"></button></span>
                <span class="tag">EPHA<button class="delete is-small"></button></span>
                <span class="tag">CFRE<button class="delete is-small"></button></span>
                <span class="tag">FIAT<button class="delete is-small"></button></span>
                <span class="tag">HNDA<button class="delete is-small"></button></span>
                <span class="tag">ALBA<button class="delete is-small"></button></span>
                <Tag tagname={this.state.tagname} />
            </div>
        )
    }
}

export default TagList;
